import React from 'react'
import '../stylesheets/connectBtn.css';
const ConnectBtn = () => {
  function handleBtn() {
    console.log("clicked")
  }
  return (
    <div className="connectBtn-wrapper">
      <button onClick={handleBtn}>Connect to Device</button>
    </div>
  )
}

export default ConnectBtn
